export default function EventBooking() {
  const { type, id } = useParams(); // type can be 'sports' or 'events'
  const navigate = useNavigate();
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [checkingAuth, setCheckingAuth] = useState(true);
  const [count, setCount] = useState(1);
  const [success, setSuccess] = useState(false);
  const [showPayment, setShowPayment] = useState(false);
  const [bookingData, setBookingData] = useState(null);

  // Get the event data based on type
  const getEventData = () => {
    if (type === 'sports') {
      return sportsData.events.find((e) => String(e.id) === id);
    } else if (type === 'events') {
      return eventsData.events.find((e) => String(e.id) === id);
    }
    return null;
  };

  const event = getEventData();

  // Check authentication status
  React.useEffect(() => {
    const token = localStorage.getItem('token');
    const username = localStorage.getItem('username');
    if (token && username) {
      setIsAuthenticated(true);
    }
    setCheckingAuth(false);
  }, []);

  const handleSignInRedirect = () => {
    navigate('/signin');
  };

  if (checkingAuth) {
    return (
      <div style={{
        maxWidth: 600,
        margin: '40px auto',
        padding: '40px',
        textAlign: 'center',
        background: '#f7f8fc',
        borderRadius: '14px',
        boxShadow: '0 4px 15px #bbb6'
      }}>
        <div style={{ fontSize: '24px', marginBottom: '16px' }}>⏳</div>
        <div>Checking authentication...</div>
      </div>
    );
  }

  if (!isAuthenticated) {
    return (
      <div style={{
        maxWidth: 600,
        margin: '40px auto',
        padding: '40px',
        textAlign: 'center',
        background: '#f7f8fc',
        borderRadius: '14px',
        boxShadow: '0 4px 15px #bbb6'
      }}>
        <div style={{ fontSize: '48px', marginBottom: '16px' }}>🔒</div>
        <h2 style={{ marginBottom: '16px', color: '#333' }}>Sign In Required</h2>
        <p style={{ color: '#666', marginBottom: '24px', lineHeight: '1.5' }}>
          You need to be signed in to book tickets. Please sign in to continue with your booking.
        </p>
        <div style={{ display: 'flex', gap: '12px', justifyContent: 'center' }}>
          <button
            onClick={handleSignInRedirect}
            style={{
              background: 'var(--accent)',
              color: 'white',
              border: 'none',
              borderRadius: '8px',
              padding: '12px 24px',
              fontSize: '16px',
              fontWeight: '600',
              cursor: 'pointer'
            }}
          >
            Sign In
          </button>
          <button
            onClick={() => navigate('/signup')}
            style={{
              background: 'white',
              color: 'var(--accent)',
              border: '1px solid var(--accent)',
              borderRadius: '8px',
              padding: '12px 24px',
              fontSize: '16px',
              fontWeight: '600',
              cursor: 'pointer'
            }}
          >
            Sign Up
          </button>
        </div>
      </div>
    );
  }

  if (!event) return <div>Event not found</div>;

  const handleBook = (e) => {
    e.preventDefault();
    
    // Prepare booking data and show payment
    const booking = {
      eventTitle: event.title,
      eventType: type,
      selectedSeats: [`Seat ${count}`], // For events, we'll use simple seat notation
      totalPrice: count * parseInt(event.price),
      showTime: event.date,
      eventId: event.id,
      venue: event.venue,
      city: event.city
    };
    setBookingData(booking);
    setShowPayment(true);
  };

  const handlePaymentSuccess = (paymentData) => {
    // Get current user info
    const currentUser = localStorage.getItem('username');
    const currentUserId = localStorage.getItem('userId') || currentUser;
    
    // Save booking to localStorage with user association
    const bookingId = paymentData.bookingId;
    const completeBooking = {
      ...bookingData,
      bookingId,
      paymentMethod: paymentData.paymentMethod,
      paymentStatus: 'success',
      bookingDate: new Date().toISOString(),
      userId: currentUserId,
      username: currentUser
    };

    // Get existing bookings from localStorage
    const existingBookings = JSON.parse(localStorage.getItem('movieBookings') || '[]');
    existingBookings.push(completeBooking);
    localStorage.setItem('movieBookings', JSON.stringify(existingBookings));

    setSuccess(true);
    setTimeout(() => {
      navigate("/my-tickets");
    }, 2000);
  };

  const handleBackToSeats = () => {
    setShowPayment(false);
  };

  const totalPrice = count * parseInt(event.price);

  return (
    <div style={{maxWidth: 800, margin: "38px auto", padding: 32, background: "#f7f8fc", borderRadius: 14, boxShadow: "0 4px 15px #bbb6"}}>
      <h2>Book your ticket</h2>
      <div style={{display: 'flex', gap: '24px', marginBottom: '24px'}}>
        <img src={event.poster} alt={event.title} style={{width: "200px", height: "300px", objectFit: "cover", borderRadius: 12}} />
        <div style={{flex: 1}}>
          <div style={{fontWeight:600, fontSize: "1.3em", marginBottom: '8px'}}>{event.title}</div>
          <div style={{color:"#888", marginBottom: '16px'}}>{event.genre}</div>
          <div style={{fontSize: '14px', color: '#666'}}>
            <div>Date: {event.date}</div>
            <div>Venue: {event.venue}</div>
            <div>City: {event.city}</div>
            <div>Type: {event.type}</div>
            <div>Price: ₹{event.price} per ticket</div>
          </div>
        </div>
      </div>

      {success ? (
        <div style={{textAlign: 'center', padding: '40px'}}>
          <div style={{color:"green", fontWeight:"bold", fontSize:"1.2em", margin:"20px 0"}}>
            Payment successful! Booking confirmed 🎉
          </div>
          <div style={{fontSize: '14px', color: '#666', marginTop: '16px'}}>
            <div>Redirecting to your tickets...</div>
          </div>
        </div>
      ) : showPayment ? (
        <PaymentComponent
          bookingDetails={bookingData}
          onPaymentSuccess={handlePaymentSuccess}
          onBack={handleBackToSeats}
        />
      ) : (
        <div>
          <form onSubmit={handleBook}>
            <div style={{marginBottom: '24px'}}>
              <label style={{display: 'block', marginBottom: '8px', fontWeight: '600'}}>
                Number of Tickets:
              </label>
              <select
                value={count}
                onChange={e => setCount(Number(e.target.value))}
                style={{
                  borderRadius: 6, 
                  fontSize: "1em", 
                  padding: "8px 12px",
                  border: "1px solid #ddd",
                  background: "white"
                }}
              >
                {[...Array(10)].map((_,i)=>
                  <option key={i+1} value={i+1}>{i+1}</option>
                )}
              </select>
            </div>

            {count > 0 && (
              <div style={{
                background: '#f0f8ff',
                padding: '16px',
                borderRadius: '8px',
                marginBottom: '20px',
                border: '1px solid #b3d9ff'
              }}>
                <div style={{fontWeight: '600', marginBottom: '8px'}}>Booking Summary:</div>
                <div style={{fontSize: '14px', color: '#666'}}>
                  <div>Event: {event.title}</div>
                  <div>Date: {event.date}</div>
                  <div>Venue: {event.venue}</div>
                  <div>Number of tickets: {count}</div>
                  <div>Price per ticket: ₹{event.price}</div>
                  <div style={{fontWeight: '600', marginTop: '4px'}}>Total: ₹{totalPrice}</div>
                </div>
              </div>
            )}

            <button
              type="submit"
              style={{
                display:"block",
                background: "var(--accent)",
                color:"#fff",
                border:"none",
                borderRadius:8,
                padding:"12px 0",
                marginTop:28,
                width:"100%",
                fontSize:"1.1em",
                fontWeight:700,
                cursor:"pointer"
              }}
            >
              Book Now - ₹{totalPrice}
            </button>
          </form>
        </div>
      )}
    </div>
  );
}
